import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, question, questions, questionId,props }){

   const q = () => getQuestionId(question.id);

    //const q = getQuestionId(2);

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{q.title}</p>


        </Paper>
    )
}

export default Question;
